SELECT ?country ?count
WHERE {
  ?country rdf:type dbo:Country ;
           dbo:volcano ?volcano .

  {
    SELECT ?country (COUNT(?volcano) AS ?count)
    WHERE {
      ?country rdf:type dbo:Country ;
               dbo:volcano ?volcano .
    }
    GROUP BY ?country
    HAVING (COUNT(?volcano) > 10)
  }
}
ORDER BY DESC(?count)

